/**
 * Returns a Character instance representing the given char value
 * 
 * @param c
 *          a char value
 * @return a Charater representation of the given char value.
 */
public static Character valueOf(char c) {
  if (c < cache.length) {
    return cache[(int) c];
  }
  return new Character(c);
}

